INSERT INTO music_db.Genre (genreId, genreName, genreDescription) VALUES (1, 'Pop', 'Pop music, often called simply pop, is contemporary music and a common type of popular music.');
INSERT INTO music_db.Genre (genreId, genreName, genreDescription) VALUES (3, 'Bubblegum dance', 'Bubblegum dance is a subgenre of Eurodance music. The genre is characterized by cute lyrics and happy sounds. Bubblegum dance usually has a more pop sound than other Eurodance. The lyrics and style are often light-hearted and are not intended to be taken seriously. ');
INSERT INTO music_db.Genre (genreId, genreName, genreDescription) VALUES (4, 'Hip-Hop/Rap', 'Hip hop, or hip-hop, is the term used to refer to a cultural movement created by African Americans, Caribbean Americans, and Latino Americans in the 1970s. It refers to hip hop music, including rap.');
INSERT INTO music_db.Genre (genreId, genreName, genreDescription) VALUES (5, 'J-Pop', 'J-pop is an abbreviation of Japanese pop. It refers to Western-influenced Japanese popular music. The term J-pop was coined by J-Wave, an FM radio station, to denote what was once called “New Music.” The term is widely used in Japan to describe many different musical genres including pop, rock, dance, rap, and soul.');
INSERT INTO music_db.Genre (genreId, genreName, genreDescription) VALUES (6, 'Electronic', 'Electronic dance music, also known as dance music, club music, or simply dance, is a broad range of percussive electronic music genres made largely for nightclubs, raves and festivals.');
INSERT INTO music_db.Genre (genreId, genreName, genreDescription) VALUES (7, 'World', 'World music (also called global music or international music) is a Western musical category encompassing many different styles of music from other parts of the globe.');
INSERT INTO music_db.Genre (genreId, genreName, genreDescription) VALUES (8, 'Electronica', 'Electronica music is produced using electrical instruments and samples of recorded music or sound. Electronica is a broad term that encompasses subgenres such as downtempo, intelligent dance music, electronic dance music, techno, house, drum and bass, trance among others.');
INSERT INTO music_db.Genre (genreId, genreName, genreDescription) VALUES (9, 'Rock', 'Rock music is a broad genre of popular music that originated as "rock and roll" in the United States in the early 1950s, and developed into a range of different styles in the 1960s and later, particularly in the United States and the United Kingdom.');
INSERT INTO music_db.Genre (genreId, genreName, genreDescription) VALUES (10, 'Metal', 'Heavy metal, genre of rock music that includes a group of related styles that are intense, virtuosic, and powerful. Driven by the aggressive sounds of the distorted electric guitar, heavy metal is arguably the most commercially successful genre of rock music.');
INSERT INTO music_db.Genre (genreId, genreName, genreDescription) VALUES (11, 'Latin Pop', 'Latin pop (Spanish and Portuguese: Pop latino) is a pop music genre that contains sounds or influence from Latin America, but it may also refer to pop music from anywhere in the Spanish-speaking world. Latin pop usually combines upbeat Latin music with American pop music.');
